import React from "react";
import PatientList from "./../PatientList/PatientList";

class WaitList extends React.Component {
    state = {
        patientName: "",
        patientId: "",
        patients: [
            { name: "xxx", id: "101" },
            { name: "zzz", id: "102" }
        ]
    };


    render() {
        return (
            <div>
                <PatientList patients={this.state.patients} queueComponent={this} />
            </div>
        );
    }
}

export default WaitList;
